import React, { useEffect, useState } from "react";
import NavbarAdmin from "./NavbarAdmin";
import axios from "axios";
const AdminViewOrders = () => {
    const [orderList, setOrderList] = useState([]);
    useEffect(() => {
        const fetchData = async () => {
            const res = await axios.get("http://localhost:5000/getOrderData");
            setOrderList(res.data);
        };
        fetchData();
    }, [])

    useEffect(() => {
        console.log(orderList);

    }, [orderList])
    return (
        <>
            <NavbarAdmin></NavbarAdmin>
            {orderList.map((e) => {
                return (
                    <div className="container-fluid " key={e._id}>
                        <div className="row">
                            <div className="col-2">Name:{e.customerName}</div>
                            <div className="col-2">Table Number:{e.tableNumber}</div>
                            <div className="col-2">Total Amount:{e.totalAmount}</div>
                        </div>
                        <div className="row">
                            <div className="col-3">
                                FoodName
                            </div>
                            <div className="col-3">
                                FoodPrice
                            </div>
                        </div>

                    </div>);
            })}
        </>
    );
};

export default AdminViewOrders;
